using System;
using System.Collections.Generic;
using System.Linq;

namespace AOC.Core.Year2018
{
    public class Day5 : IDay
    {
        private string Input;

        public Day5()
        { 
            this.Input = "";
        }

        public string Part1()
        {
            return this.ProcessInput(this.Input).Length.ToString();
        }

        public string Part2()
        {
            var processed = new List<string>();

            for (char c = 'A'; c <= 'Z'; c++)
            {
                var tempInput = this.Input;
                tempInput = tempInput.Replace(c.ToString(), string.Empty);
                tempInput = tempInput.Replace(c.ToString().ToLower(), string.Empty);
                processed.Add(this.ProcessInput(tempInput));
            }

            return processed.Max(x => x.Length).ToString();
        }

        private string ProcessInput(string input)
        {
            var finished = false;

            while (!finished)
            {
                var tempInput = input;

                for (int i = 0; i < input.Length - 1; i++)
                {
                    var charA = input[i];
                    var charB = input[i + 1];
                    if (charA != charB && ((char.IsUpper(charA) && char.IsLower(charB)) || (char.IsLower(charA) && char.IsUpper(charB))) && (char.ToLower(charA) == char.ToLower(charB)))
                    {
                        input = input.Remove(i, 2);
                        break;
                    }
                }

                finished = tempInput.Length == input.Length;

            }

            return input;
        }
    }
}
